def pretextgraph(bin, dir):
    n_max = 3
    n = 0
    while True:
        try:
            check_output(bin)

            input_name = "input_map"
            output_name = "output_map"

            input_map_path = os.path.join(dir, input_name)
            output_map_path = os.path.join(dir, output_name)

            with open(input_map_path, "wb") as file:
                file.write(bz2.decompress(pretext_map))

            read, write = os.pipe()

            def thread_fn():
                with os.fdopen(write, "wb") as file:
                    file.write(bz2.decompress(bedgraph))

            thread = Thread(target=thread_fn)
            thread.start()

            with Popen(
                [bin, "-i", input_name, "-n", "test graph", "-o", output_name],
                stdin=read,
                stdout=PIPE,
                stderr=STDOUT,
                cwd=dir,
            ) as process:
                ret, err = process.communicate()
                print(
                    "STDOUT: {out}".format(
                        out=ret.decode("utf-8", errors="ignore") if ret else "<none>"
                    )
                )
                print(
                    "STDERR: {err}".format(
                        err=err.decode("utf-8", errors="ignore") if err else "<none>"
                    )
                )
                if process.returncode == -4:
                    pytest.skip("SIGFPE: assuming extension is unsupported")
                assert process.returncode == 0

            thread.join()

            with open(output_map_path, "rb") as file:
                assert file.read() == bz2.decompress(graph_map)
            return

        except Exception as ex:
            n += 1
            if n == n_max:
                raise ex


def test_pretextgraph(tmpdir):
    bin = os.path.join(os.getcwd(), "PretextGraph")
    pretextgraph(bin, tmpdir)


